import "./App.css";
import React, { useState } from "react";
import Sudoku from "./Sudoku";
import Interface from "./Interface";

function App() {
  const [language, setLanguage] = useState('en');

  const toggleLanguage = () => {
    setLanguage(prevLanguage => prevLanguage === 'en' ? 'jp' : 'en');
  };

  const handleInterface = (action) => {
    console.log(`Action: ${action}`);
  };

  return (
    <div className="App">
      <header className="App-header">
        <h2>{language === 'en' ? '' : 'すうどく'}</h2>
        <h1>{language === 'en' ? 'Sūdoku' : '数独'}</h1>
        <button className="language-button" onClick={toggleLanguage}>
          {language === 'en' ? 'JP' : 'EN'}
        </button>
      </header>
      <Sudoku />
      <Interface handleInterface={handleInterface} status="Puzzle Status" language={language} />
    </div>
  );
}

export default App;
